import { Link } from 'react-router-dom';
import styled from 'styled-components'

const Ul = styled.ul`
        
    margin-left: auto;
    margin-right: 50px;
    flex-flow: row rowrap;
    display: flex;
    list-style: none;

    .links li{
        margin-left: 40px;
        text-decoration: none;
        padding: 10px;
        color: white;
    }
    .links a:hover {
        color: #f1356d;
    }
    @media (max-width: 768px){
        flex-flow: column rowrap;
    }
`;

const RightNav = () => {
    return ( 
        <Ul>
            <div className = "links">
                <li>Home</li>
                <li>About Us</li>  
            </div>
        </Ul>
    );
}
 
export default RightNav;
